import React, { Component } from 'react';
import './style.css';

export default class Cadastro extends Component {
    render() {
        return (
            <div>
                <input type="checkbox" id="check" />
                    <label for="check">
                        <i class="fas fa-bars" id="btn"></i>
                        <i class="fas fa-times" id="cancel"></i>
                    </label>
                    
            </div>
        )
    }
}
